	/**
	 * 产品管理> 结构工具
	 * @param applicationDomain 数据哪个数据库下
	 * @param contextInfo json参数信息
	 * @return
	 */
	@RequestMapping(value = "/GoldenStandABS/service/DataProcessService.svc/jsAccessEP/ExecuteDataTable", 
			method = RequestMethod.POST,
			consumes="application/json; charset=utf-8")
	@ResponseBody
	public String ExecuteDataTable(@RequestBody ExecuteDataTableReq req) {	
		/*@RequestParam(name = "connectionName") String connectionName,
		@RequestParam(name = "param") String param*/
		String connectionName=req.getConnectionName();
		String param=req.getParam();
		param=UrlUtil.getURLDecoderString(param);
		logger.info("ExecuteDataTable----参数信息--connectionName:" + req.getConnectionName()
				+ "-----param:" + param);
		CommonExecuteReq executeReq=new CommonExecuteReq();
		executeReq.setAppDomain(connectionName);
		executeReq.setExecuteParams(FastJsonUtils.getJsonToBean(param, ExecuteParamsReq.class));
		List<Map<String, Object>> list = trustManagementService
				.CommonExecuteGet(executeReq);
		String json = FastJsonUtils.getBeanToJson(list);
		return json; 
	}
	
	/**
     * 公共调用方法
     * @return
     */
	@ResponseBody
	@RequestMapping(value = "/service/DataProcessService.svc/jsAccessEP/CommonExecuteGet", method = RequestMethod.GET)
	public String CommonExecuteGet(
			@RequestParam(name = "appDomain") String appDomain,
			@RequestParam(name = "executeParams") String executeParams) {
		
		logger.info("跳转到公共调用方法----参数信息--appDomain:" + appDomain
				+ "-----executeParams:" + executeParams);
		
		CommonExecuteReq executeReq=new CommonExecuteReq();
		executeReq.setAppDomain(appDomain);
		executeReq.setExecuteParams(FastJsonUtils.getJsonToBean(executeParams, ExecuteParamsReq.class));
		List<Map<String, Object>> list = trustManagementService
				.CommonExecuteGet(executeReq);

		String json = FastJsonUtils.getBeanToJson(list);

		return json;
	}
	
	
	
